// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;
import "contracts/LogLibrary.sol";
// 实现特性：
// 1.fallbcak转发逻辑合约
// 2._fallback返回数据汇编处理
// 3.逻辑合约可升级，可升级权限管理（adminAddress）
// 3.内存布局一致性处理（自定义存储槽ERC1967）
contract MyUpgradeProxy {
    using LogLibrary for *;
    // 保证内存布局一致性
    uint256 private counter;
    // 逻辑合约地址
    address public logicAddress;
    address public adminAddress;
    constructor(address _logicAddress) {
        logicAddress = _logicAddress;
        adminAddress = msg.sender;
    }
    fallback() external payable {
        // 转发到逻辑合约
        // (bool success, bytes memory resultData) = logicAddress.delegatecall(msg.data);
        // require(success, "delegatecall failed");
        // "delegatecall.resultData:".printBytesLog(resultData);
        _delegate(logicAddress);
    }
    receive() external payable {}
    function _delegate(address implementation) internal {
        assembly {
            // Copy msg.data. We take full control of memory in this inline assembly
            // block because it will not return to Solidity code. We overwrite the
            // Solidity scratch pad at memory position 0.
            calldatacopy(0, 0, calldatasize())

            // Call the implementation.
            // out and outsize are 0 because we don't know the size yet.
            let result := delegatecall(gas(), implementation, 0, calldatasize(), 0, 0)

            // Copy the returned data.
            returndatacopy(0, 0, returndatasize())

            switch result
            // delegatecall returns 0 on error.
            case 0 {
                revert(0, returndatasize())
            }
            default {
                return(0, returndatasize())
            }
        }
    }
    // 升级合约
    function upgradeLogicAddress(address newLogicAddress) external {
        require(msg.sender == adminAddress, "only admin can upgrade");
        logicAddress = newLogicAddress;
    }
}

// v1合约：只支持自增1
contract LogicV1 {
    uint256 private counter;
    function increa() external {
        counter++;
    }
    function getCounter() external view returns (uint256) {
        return counter;
    }
}

// v2合约：支持自增1，自减1，支持自增任意数字
contract LogicV2 {
    uint256 private counter;
    function increa() external {
        counter++;
    }
    function increaBy(uint256 num) external {
        counter += num;
    }
    function decrea() external {
        counter--;
    }
    function getCounter() external view returns (uint256) {
        return counter;
    }
}

